- input: "TEXT\x1CC00250134\x1CTEXT-2010-M8\x1C\x1CF3XA\x1COn 07/19/2010, we voided
    our check # 2620 issued on 10/20/2009 to the Kentucky Democratic Party because
    it had been outstanding more than 180 days. Unbeknownst to us, the check cleared
    our bank account on 06/28/2010, and we did not discover this until we reconciled
    our bank account, at which time we had already filed our 2010 August 20 Report
    covering 07/01/2010-07/31/2010. We have removed the voiding of this check in this
    amended Report for the same period.\n"
